import{_ as a,o as e,c as t,V as o}from"./chunks/framework.0fd66c21.js";const f=JSON.parse('{"title":"202306","description":"","frontmatter":{},"headers":[],"relativePath":"Monthly/202306.md","lastUpdated":1685735077000}'),r={name:"Monthly/202306.md"},l=o('<h1 id="_202306" tabindex="-1">202306 <a class="header-anchor" href="#_202306" aria-label="Permalink to &quot;202306&quot;">​</a></h1><p><img src="https://s2.loli.net/2023/06/03/5pH8GPAdoIr4htk.jpg" alt="4d086e061d950a7b8473eecb0cd162d9f2d3c97f"></p><h2 id="随便看看" tabindex="-1">随便看看 <a class="header-anchor" href="#随便看看" aria-label="Permalink to &quot;随便看看&quot;">​</a></h2><h2 id="技术动态" tabindex="-1">技术动态 <a class="header-anchor" href="#技术动态" aria-label="Permalink to &quot;技术动态&quot;">​</a></h2><ul><li></li></ul><h2 id="实用工具" tabindex="-1">实用工具 <a class="header-anchor" href="#实用工具" aria-label="Permalink to &quot;实用工具&quot;">​</a></h2><h2 id="随机领域" tabindex="-1">随机领域 <a class="header-anchor" href="#随机领域" aria-label="Permalink to &quot;随机领域&quot;">​</a></h2><h3 id="cms-内容安利系统" tabindex="-1">CMS（内容安利系统） <a class="header-anchor" href="#cms-内容安利系统" aria-label="Permalink to &quot;CMS（内容安利系统）&quot;">​</a></h3><p>CMS是一种用于创建、编辑和发布数字内容的平台。它通常被用于网站、博客、电子商务网站等在线应用程序中。CMS平台使得非技术人员也可以轻松地创建和管理网站内容。通常包括一个用户友好的后台管理界面，使得用户可以轻松地添加、删除或修改网站内容，而无需具备编程知识。这些平台还提供了许多功能，例如搜索引擎优化(SEO)、安全性、版本控制、多语言支持等，以便用户能够更好地管理和维护他们的网站。</p><p>流行服务：WordPress、Shopify和Ghost等</p><h3 id="faas-函数即服务" tabindex="-1">FaaS（函数即服务） <a class="header-anchor" href="#faas-函数即服务" aria-label="Permalink to &quot;FaaS（函数即服务）&quot;">​</a></h3><p>功能即服务 (FaaS) 是在边缘执行模块化代码段的无服务器方法。FaaS 使开发人员可以即时编写和更新一段代码，然后在响应事件（例如用户单击 Web 应用程序中的元素）时执行该代码。这使得扩展代码变得容易，并且是实现微服务的一种经济高效的方法。</p><p>流行服务：CloudFlare Workers、Google App Engine等</p>',13),s=[l];function h(i,n,d,c,_,p){return e(),t("div",null,s)}const m=a(r,[["render",h]]);export{f as __pageData,m as default};
